INSERT INTO `gc_room` VALUES ('n004', '30金 / 1-5倍', 'C01', 'G022', '0', '200', '897', '/img/home/game_icon_G022.png', null, null, null, null, '0', null, '0.05', null, '0', null, '<div><span style=\"font-size: 13.3333px;\">游戏</span><span style=\"font-size: 13.3333px;\">规则：</span></div><div>1倍 = 牛一，牛二、牛三、牛四、牛五、牛六</div><div>2倍 = 牛七、牛八</div><div>3倍 = 牛九、牛牛</div><div>4倍 = 对子、0.10到0.90金</div><div>5倍 = 顺子，豹子</div><div>初始红包5个</div><div>红包过期时间60秒</div><div>最多红包个数10个</div><div>2点以下闲输。<br></div><div><br></div><div>抢庄规则<span style=\"font-size: 13.3333px;\">：</span></div><div>当游戏是停止状态时，玩家可点击“抢庄”按钮开始抢庄，系统发出一个1金币的红包，想坐庄的人参与这个包的抢夺，谁抢到最大谁就是庄家。如果只有一个人抢庄或者人数不足，过期时间到谁大谁坐庄。</div><div><br></div><div>抢庄条件：（10金币底注为例）</div><div>如果这个房间最大倍数是5倍，庄家需要拥有：5（最高倍数）*10（底注）* 5（红包个数） = 250 金币才能参与抢庄。</div><div><br>庄家发包：</div><div>庄家点房间左下角的圆形加号发出游戏包，根据房间的玩家的数量，决定发的包数。</div><div><br></div><div>发包金额：</div><div>发包金额，系统按照发包数 x 0.5的金额。</div><div><br></div><div>防止逃包：（10金币底注为例）</div><div>当玩家点击拆红包时，系统会冻结他的账户金额，玩家冻结金额如下：（最大倍数）5 *（底注）10 = 50 金币。当红包抢完，或者过期时间到，系统把输赢金币加上押金一起返回给玩家，以避免逃包的情况发生。&nbsp;</div><div><br></div><div>换庄规则：</div><div>当庄家停止发包60秒后，其他玩家可重新点击抢庄。</div><div><br></div><div>关于庄家点数：</div><div>庄家自己可以抢头包，如抢包速度过快或庄家出现网络问题系统会为庄家抢上最后一个包。以防出现本局无效的争论，影响到各玩家的美好心情。</div>', '28562', null);
