INSERT INTO `gc_room` VALUES ('s020', '300金7包1.5倍', 'C01', 'G04', '0', '2000', '18', '/img/home/game_icon_lei.png', null, null, null, null, '0', null, '0.1', null, '30', null, '游戏规则：\n\n用户可自由发包，发包的时候自己设定个雷号，比如雷写1，抢包的人谁抢到尾数为1的，抢包的人从账户扣除相应倍数的金额，发包者得到该金额\n例如：\nA用户发10金 5包 雷1\nB用户抢包时抢到2.01\n则\nB用户扣除20金币\nA用户得到20金币\n\n倍数说明：\n5包 = 2倍\n6包 = 1.8倍\n7包 = 1.5倍\n8包 = 1.3倍\n9包 = 1.2倍\n\n10包 = 1.1倍', '2', null);
