INSERT INTO `gc_room` VALUES ('j001', '5金5包', 'C01', 'G011', '0', '200', null, '/img/home/game_icon_max.png', null, null, null, null, '0', null, '0.3', null, '8.399999999999999', '0', '<span style=\"font-size: 13.33px;\">游戏</span><span style=\"font-size: 13.33px;\">规则：</span><div><div>进房间后如果没人玩可以点右上角开始按钮，系统会发出一个1金币的初始包，抢到最大金币值的人系统会强制扣除 该玩家账户的对应金额自动发出红包，然后一直循环下去。例如红包包数为5，过期时间设定为60秒，时间到参与抢红包的人不足5人，游戏停止，初始包金额不计入账户，玩家需要重新申请游戏开发。<br></div><div><font face=\"helvetica, arial, verdana, sans-serif\"><br></font></div><div>关于逃包<span style=\"font-size: 13.33px;\">：</span></div><div><font face=\"helvetica, arial, verdana, sans-serif\">玩家拆红包参与游戏，系统会先冻结红包金额大小的金币，当玩家退出群后返还给玩家，避免逃包。 &nbsp;</font></div></div><div><font face=\"helvetica, arial, verdana, sans-serif\"><br></font></div><div>防作弊功能：</div><div>当玩家发出红包时，在红包没有被抢光时，只能看见自己抢的金额，防止因为别人抢大包其他人不愿抢红包的问题，红包抢光时再点进红包可以看见每个人抢的金额！</div>', '28', null);
