-- ----------------------------
-- Table structure for vc_vorder_exp
-- ----------------------------
DROP TABLE IF EXISTS `vc_vorder_exp`;
CREATE TABLE `vc_vorder_exp` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `useracc` varchar(32) NOT NULL DEFAULT '0' COMMENT '用户账号',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `pname` varchar(30) DEFAULT NULL COMMENT '商品名称',
  `gid` int(11) NOT NULL DEFAULT '0' COMMENT '游戏ID',
  `gname` varchar(30) DEFAULT NULL COMMENT '游戏名称',
  `gaid` int(11) NOT NULL DEFAULT '0' COMMENT '游戏分区ID',
  `ganame` varchar(30) DEFAULT NULL COMMENT '游戏分区名称',
  `gsid` int(11) NOT NULL DEFAULT '0' COMMENT '游戏服务器ID',
  `gsname` varchar(30) DEFAULT NULL COMMENT '游戏服务器名称',
  `rtype` smallint(2) NOT NULL DEFAULT '0' COMMENT '游戏充值方式， 1 支付宝，2 微信， 9 支付宝PC,',
  `sid` int(11) NOT NULL DEFAULT '0' COMMENT '供货商id',
  `orderid` varchar(64) DEFAULT NULL COMMENT '订单号',
  `reqtime` datetime DEFAULT NULL COMMENT '用户渠道请求时间',
  `accounts` varchar(100) NOT NULL COMMENT '充值账号,多级账号以“,”分隔',
  `amount` decimal(11,3) NOT NULL DEFAULT '1.000' COMMENT '购买数量',
  `money` decimal(10,3) NOT NULL DEFAULT '1.000' COMMENT '订单现金支付金额',
  `price` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '用户购买时的单价',
  `tfee` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '金额---预留字段',
  `bfee` decimal(10,3) DEFAULT '0.000' COMMENT '余额支付金额',
  `tradeno` varchar(64) DEFAULT NULL COMMENT '充值平台的订单号',
  `paytime` datetime DEFAULT NULL COMMENT '支付时间',
  `rsn` varchar(30) DEFAULT NULL COMMENT '请求供货商交易流水号',
  `tsn` varchar(30) DEFAULT NULL COMMENT '供货商返回交易流水号',
  `consTime` datetime DEFAULT NULL COMMENT '请求充值发起时间',
  `compTime` datetime NOT NULL COMMENT '请求充值完成时间',
  `ecode` varchar(20) DEFAULT NULL COMMENT '充值结果返回码',
  `dxcode` varchar(20) DEFAULT NULL COMMENT '渠道结果返回码',
  `emsg` varchar(100) DEFAULT NULL COMMENT '充值结果描述',
  `status` smallint(2) DEFAULT '0' COMMENT '到供货商充值状态 0:待充值 1:充值中 2:充值成功 3:充值失败 4:异常',
  `qtimes` smallint(2) NOT NULL DEFAULT '-1' COMMENT '充值结果查询次数',
  `nqtime` datetime DEFAULT NULL COMMENT '充值结果下次查询时间',
  `syntimes` smallint(2) NOT NULL DEFAULT '-1' COMMENT '同步结果次数',
  `syntime` datetime DEFAULT NULL COMMENT '充值结果下次时间',
  `createTime` datetime DEFAULT NULL COMMENT '添加时间',
  `callbackUrl` varchar(2000) DEFAULT NULL COMMENT '回调地址',
  `requestIp` varchar(32) DEFAULT NULL COMMENT '请求IP',
  `etype` smallint(1) DEFAULT '0' COMMENT '充值类型 0:不指定 其他值为各游戏特有',
  `qrcode` varchar(100) DEFAULT NULL,
  `jprice` decimal(10,3) DEFAULT NULL COMMENT '进货价',
  `mprice` decimal(11,2) DEFAULT NULL COMMENT '面值',
  `randomarg` varchar(64) DEFAULT NULL COMMENT '随机参数',
  `usertype` smallint(1) DEFAULT NULL COMMENT '用户类别，0 临时用户，1 正式用户',
  `chl` varchar(50) DEFAULT NULL COMMENT '渠道编号',
  `cashstatus` smallint(1) DEFAULT '0' COMMENT '结算状态 0-未结算 1-审核中 2-待结算 3-结算完成则转为待支付 4-结算驳回 5-支付完成 9-不能结算',
  `cashId` bigint(20) DEFAULT NULL COMMENT '结算单id',
  `cratio` decimal(4,3) DEFAULT NULL COMMENT '渠道分成比例',
  `province` varchar(50) DEFAULT NULL COMMENT '省份',
  `city` varchar(100) DEFAULT NULL COMMENT '城市',
  `isp` varchar(50) DEFAULT NULL COMMENT '运营商',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_vorder_osn` (`orderid`) USING BTREE,
  UNIQUE KEY `idx_vorder_rsn` (`rsn`) USING BTREE,
  KEY `idx_vorder_status` (`status`) USING BTREE,
  KEY `idx_vorder_reqtime` (`reqtime`) USING BTREE,
  KEY `idx_vorder_qtimes` (`qtimes`) USING BTREE,
  KEY `idx_vorder_syntimes` (`syntimes`) USING BTREE,
  KEY `idx_vorder_accounts` (`accounts`) USING BTREE,
  KEY `idx_vorder_createtime` (`createTime`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of vc_vorder_exp
-- ----------------------------

-- ----------------------------
-- Table structure for vc_vorder_tmp
-- ----------------------------
DROP TABLE IF EXISTS `vc_vorder_tmp`;
CREATE TABLE `vc_vorder_tmp` (
  `orderId` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '订单号',
  `status` smallint(6) DEFAULT '0' COMMENT '订单的状态 0：预订单 1：未支付 2：支付成功 3：支付失败 4：异常订单 5：退款 6：操作中',
  `rtype` smallint(6) DEFAULT NULL COMMENT '充值方式',
  `qtimes` int(11) DEFAULT NULL COMMENT '充值结果查询次数',
  `nqtime` datetime DEFAULT NULL COMMENT '充值结果下次查询时间',
  `ecode` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '结果编码',
  `emsg` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '结果描述',
  `createtime` timestamp NULL DEFAULT NULL COMMENT '订单的产生时间',
  `pid` int(11) DEFAULT NULL COMMENT '商品id',
  `money` decimal(10,3) DEFAULT NULL COMMENT '充值金额',
  `pname` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '商品名称',
  `bal` decimal(10,3) DEFAULT NULL COMMENT '余额',
  `useracc` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '用户账号',
  `accounts` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '充值账号,多级账号以“,”分隔',
  `amount` decimal(11,3) DEFAULT NULL COMMENT '充值数量',
  `tfee` decimal(11,3) DEFAULT NULL COMMENT '充值总金额',
  `reqtime` datetime DEFAULT NULL COMMENT '用户渠道请求时间',
  `randomarg` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '随机参数',
  `gaid` int(11) DEFAULT NULL COMMENT '游戏分区ID',
  `gsid` int(11) DEFAULT NULL COMMENT '游戏服务器ID',
  `qrcode` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '二维码',
  `usertype` smallint(6) DEFAULT NULL COMMENT '用户类别，0 临时用户，1 正式用户',
  `chl` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '渠道编码',
  `requestIp` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '请求IP',
  `etype` smallint(6) DEFAULT NULL COMMENT '充值类型 0:不指定 其他值为各游戏特有',
  PRIMARY KEY (`orderId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='临时订单';

-- ----------------------------
-- Records of vc_vorder_tmp
-- ----------------------------

-- ----------------------------
-- Event structure for clear_log
-- ----------------------------
DROP EVENT IF EXISTS `clear_log`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` EVENT `clear_log` ON SCHEDULE EVERY 5 MINUTE STARTS '2017-04-13 12:42:00' ON COMPLETION PRESERVE ENABLE DO BEGIN
delete from gc_lottery_detail where uid < 1400 and uid > 0 and createDate < DATE_SUB(NOW(),INTERVAL  10 MINUTE);
delete from gc_lottery where sender < 1400 and sender > 0 and createTime < DATE_SUB(NOW(),INTERVAL  10 MINUTE);
END
;;
DELIMITER ;
